import { NavLink } from "react-router-dom";

const StyledNavLink = ({ content, link }) => {
  return (
    <NavLink
      key="hero"
      to={link}
      style={({ isActive }) => {
        return {
          textDecorationLine: "none",
          color: isActive ? "gold" : "#108c43",
        };
      }}
    >
      {content}
    </NavLink>
  );
};

export default StyledNavLink;
